import Category from "../componets/Category";

function CategoryList(props){
    return(
        <div>
            <h2>Kategooriad:</h2>

            {props.category.map(item=>(
                <Category 
                key={item.key} 
                name={item.name}></Category>
    ))}

        </div>
    )
}

export default CategoryList
